import 'package:flutter/material.dart';
void main(){
  runApp(const DisplayImage());
}
class DisplayImage extends StatefulWidget{

const DisplayImage({super.key});
@override
State createState()=> _DisplayimageState();

}
class _DisplayimageState extends State{
  
  List<String> Imagelist = ["data:image/jpeg;base64,","data:image/jpeg;base64,","data:image/jpeg;base64,"];

  @override
   Widget build(BuildContext context){
       return MaterialApp(
      debugShowCheckedModeBanner: false,
         home: Scaffold(
         backgroundColor:Color.fromARGB(224, 78, 78, 135) ,
          appBar: AppBar(
            title: const Text("Listview builder"),
            centerTitle: true,
          ),
        body: ListView.builder(
          itemCount: Imagelist.length,
          itemBuilder: (context, index) {
            return Container(
              height: 200,
              margin: EdgeInsets.all(50),
               child: Image.network(Imagelist[index]),
            );

          }
        ),


        ),
       );


   }




}